package com.android.task.newsstoriessample.utils

import android.content.Context
import okhttp3.MediaType
import okhttp3.ResponseBody
import org.junit.After
import org.junit.Before
import org.junit.Test

import org.junit.Assert.*
import org.mockito.Mockito

class ImageUtilTest {

	private lateinit var context: Context

	@Before
	fun setUp() {
		context = Mockito.mock(Context::class.java)
	}

	// Test that processResponse is work successfully.
	@Test
	fun processResponseTest() {
		val body = ResponseBody.create(
			MediaType.parse("image/jpeg"),
			"isThisEnoughForTest"
//			""
		)
		val imageFile = ImageUtil.processResponse(context, body)
		assert(imageFile != null)

		val bodyEmpty = ResponseBody.create(
			MediaType.parse("image/jpeg"),
			ByteArray(0)
		)
		val imageFileNull = ImageUtil.processResponse(context, bodyEmpty)
		assert(imageFileNull == null)
	}
}